      // }
      console.log("Variables texts : ", texts);
      // console.log("Variables texts : ", texts[0]);
      // console.log("Variables texts : ", texts[1]);
      // setOk(!ok);
    });
  };

  return (
    <div>
      <form method="POST" action="#" id="#" onSubmit={handleSubmission}>
        <input
          type="text"
          placeholder="Search..."
          onChange={(e) => setSearched(e.target.value)}
        />
        <input className="add" type="submit" />
      </form>

      {texts.map(({ text, titre }, i) => (
        <li style="list-style-type : none;" key={i}>
          {" "}
          <h1>{titre}</h1> {text} {""}{" "}
        </li>
      ))}
    </div>
  );
}
export default Search;
